        const string DateFormat = "dd.MM.yyyy";
        /// <summary>
        /// Генерирует заданное количество записей для таблицы "История ухода"
        /// </summary>
        /// <param name="Count"></param>
        public static void generateCareHistory(int Count, ProgressBarDelegate progress)
        {
            Random random = new Random();

            string SQL_Plant_ID = "SELECT \"код_растения\" FROM \"Растения\" WHERE \"дата_гибели\" IS NULL";
            string SQL_Fertilizers = "SELECT \"код_средства\" FROM \"Средства ухода\"";
            string SQL_PlantAndStuff = "SELECT \"код_растения\", \"дата_посадки\",\"код_сотрудника\" FROM \"Участки\" " +
                "JOIN \"Сотрудники\" ON \"Участки\".\"регистрационный_номер_сада\" = \"Сотрудники\".\"регистрационный_номер_сада\" " +
                "JOIN \"Растения\" ON \"Участки\".\"код_участка\" = \"Растения\".\"код_участка\" " +
                "WHERE \"Растения\".\"дата_гибели\" IS NULL";

            List<int> PlantCodes = convert_column_in_list(SQL_Plant_ID).Select(x => Convert.ToInt32(x)).ToList();
            List<int> Fertilizers = convert_column_in_list(SQL_Fertilizers).Select(x => Convert.ToInt32(x)).ToList();
            DataTable PlantAndStuff = MainForm.getDataTable(SQL_PlantAndStuff);

            bool Control = false;
            int CountNesting = 0;

            for (int i = Count; i > 0 && !StopGenerate; --i)
            {
                int PlantCode = PlantCodes[random.Next(0, PlantCodes.Count)];   //Код растения

                DataRow[] Plant_Stuffs = PlantAndStuff.Select($"код_растения = {PlantCode}");

                if (Plant_Stuffs.Length == 0)
                {
                    i++;

                    if (!Control && CountNesting == 2000)
                        throw new Exception("Нет данных на основе которых можно генерировать!");

                    continue;
                }

                Control = true;

                DateTime ProcessingDate = get_RandomDate(DateTime.Parse(Convert.ToString(Plant_Stuffs[0][1])), DateTime.Now, random);   //Дата обработки
                int CodeFertilizer = Fertilizers[random.Next(0, Fertilizers.Count)];    //Код удобрения
                int CodeStuff = Convert.ToInt32(Plant_Stuffs[random.Next(0, Plant_Stuffs.Length)][2]);  //Код сотрудника(из того же сада что и растение)
                int CountFertilizerUsed = random.Next(0, 51);   //Количество использованного удобрения

                string SQL_INSERT = "INSERT INTO \"История ухода\" ( \"код_растения\", \"дата_обработки\", \"код_средства\", \"код_сотрудника\", \"количество_упоковок\") VALUES " +
                    $"( {PlantCode}, \'{ProcessingDate.ToString(DateFormat)}\', {CodeFertilizer}, {CodeStuff}, {CountFertilizerUsed} );";

                //Console.WriteLine(SQL_INSERT);

                try { MainForm.put_sql(SQL_INSERT); } catch {};

                random = new Random(random.Next(0, int.MaxValue));

                if (progress != null)
                    progress(i);
            }

        }
        /// <summary>
        /// Генерирует заданное количество записей для таблицы "Растения"
        /// </summary>
        /// <param name="Count"></param>
        public static void generatePlatns(int Count, ProgressBarDelegate progress)
        {
            Random random = new Random();

            //string SQL_Plots = "SELECT \"код_участка\" FROM \"Участки\"";
            string SQL_PlotsDataGarden = "SELECT \"код_участка\", \"год_открытия\" FROM \"Участки\" " +
                "JOIN \"Сады\" ON \"Участки\".\"регистрационный_номер_сада\" = \"Сады\".\"регистрационный_номер\"";
            string SQL_Catalog = "SELECT \"номер_растения_в_каталоге\" FROM \"Каталог\"";

            //List<int> Plots = convert_column_in_list(SQL_Plots).Select(x => Convert.ToInt32(x)).ToList();
            DataTable Plots = MainForm.getDataTable(SQL_PlotsDataGarden);
            List<long> Catalogs = MainForm.getDataTable(SQL_Catalog).AsEnumerable().Select(r => r.Field<Int64>("номер_растения_в_каталоге")).ToList();

            ///Списи требований ухода(содержания).
            List<string> One_list = new List<string>() { "Светолюбивое (20000 - 10000люкс)", "Тенелюбивое (1000 - 500люкс)", "Теневыносливое (5000 - 1000люкс)", "Интенсивность освещения: естественное освещение (50000 - 100000 люкс)", "Хорошо освещенная местность (15000 - 30000 люкс)", "Слабо освещенная местность (8000 - 12000 люкс)" };
            List<string> Two_list = new List<string>() { "Требуемая длина светодня: Короткий", "Требуемая длина светодня: Нейтрально", "Требуемая длина светодня: Длительно" };
            List<string> Three_list = new List<string>() { "Требуемая температора: Первая группа (10 - 12оС)", "Требуемая температора: Вторая группа (15 - 18оС)", "Требуемая температора: Третья группа (21 - 25оС)" };
            List<string> Four_list = new List<string>() { "Сигнал опасности нарушения температурного режима: Листья сворачиваются, темнеют и падают (слишком низкая температура)", "Сигнал опасности нарушения температурного режима: Нижние листья увядают, края листьев желтеют (высокая температура)", "Сигнал опасности нарушения температурного режима: Цветки быстро увядают (слишком теплый воздух)", "Сигнал опасности нарушения температурного режима: Вытянутые стебли и листья при хорошем освещении (слишком теплый воздух)", "Сигнал опасности нарушения температурного режима: Листья быстро желтеют и опадают (перепад температуры)" };
            List<string> Five_list = new List<string>() { "Режим полива: Обильный полив проводят сразу после пересыхания земляного кома.", "Режим полива: Умеренный полив - растение поливают через 2 - 3 дня после пересыхания земли.", "Режим полива: Редкий полив - растение поливают через несколько недель, месяцев или дней." };

            for (int i = Count; i > 0 && !StopGenerate; --i)
            {
                int PosotionInTalbe = random.Next(0, Plots.Rows.Count);

                long PlotCode = Convert.ToInt64(Plots.Rows[PosotionInTalbe][0]); //Код участка
                long CatalogCode = Catalogs[random.Next(0, Catalogs.Count)];   //Код в каталоге
                ///Фото растения пока будет NULL
                DateTime BoardingDate = get_RandomDate(new DateTime(Convert.ToInt32(Plots.Rows[PosotionInTalbe][1]), 1, 1), DateTime.Now, random);   //Дата посадки
                DateTime DateDead = get_RandomDate(BoardingDate, DateTime.Now, random);  //Дата гибели
                int СostSeed = random.Next(0, 10000);   //Цена ростка
                string ConditionsDetention = "";    //Условиях ухода и содержания

                bool Image_accept = random.Next(0, 700) == 1;
                bool DateDead_accept = random.Next(0, 30) == 1;

                //if (DateDead_accept)
                //    DateDead = get_RandomDate(BoardingDate);

                ConditionsDetention = $"{One_list[random.Next(0, One_list.Count)]}\n" +
                    $"{Two_list[random.Next(0, Two_list.Count)]}\n" +
                    $"{Three_list[random.Next(0, Three_list.Count)]}\n" +
                    $"{Four_list[random.Next(0, Four_list.Count)]}\n" +
                    $"{Five_list[random.Next(0, Five_list.Count)]}";

                string SQL_INSERT_VALUES = $"{PlotCode}, {CatalogCode}, @Image, " + //{(Image_accept ? "NULL" : "NULL")}
                    $"\'{BoardingDate.ToString(DateFormat)}\', {(DateDead_accept ? $"\'{DateDead.ToString(DateFormat)}\'" : "NULL")}, " +
                    $"{СostSeed}, \'{ConditionsDetention}\'";

                string SQL_INSERT = "INSERT INTO \"Растения\" " +
                    "(\"код_участка\", \"номер_в_каталоге\", \"фото_растения\", \"дата_посадки\", \"дата_гибели\", \"стоимость_саженца\", \"условия_ухода_и_содержания\") VALUES " +
                    $"( {SQL_INSERT_VALUES} );";

                NpgsqlParameter param_image = MainForm.cmd.CreateParameter();
                param_image.ParameterName = "@Image";
                param_image.NpgsqlDbType = NpgsqlTypes.NpgsqlDbType.Bytea;
                param_image.Value = DBNull.Value;

                if (Image_accept && Directory.Exists("Images_Plants"))
                {
                    string[] images_path = Directory.GetFiles("Images_Plants");
                    string path_img = images_path[random.Next(0, images_path.Length)];

                    try
                    {
                        Bitmap img_source = new Bitmap(path_img);//= new Bitmap(@"Images_Plants\anemona-krasnyy-cvetok.jpg");

                        using (MemoryStream ms = new MemoryStream())
                        {
                            img_source.Save(ms, System.Drawing.Imaging.ImageFormat.Jpeg);
                            param_image.Value = ms.ToArray();
                        }

                    }
                    catch { };

                    //try
                    //{
                    //    MainForm.insert_data(SQL_INSERT, param_image);
                    //} catch { };
                }
                //else
                
                try { MainForm.put_sql(SQL_INSERT, param_image); } catch {};

                //Console.WriteLine(SQL_INSERT);
                random = new Random(random.Next(0, int.MaxValue));
                //await Task.Delay(1);
                if (progress != null)
                    progress(i);
            }

        }
