        /// <summary>
        /// Генерирует заданное количество записей для таблицы "Сотрудники"
        /// </summary>
        /// <param name="Count"></param>
        /// <exception cref="Exception"></exception>
        public static void generateStuff(int Count, ProgressBarDelegate progress)
        {
            string SQL_RN = "SELECT \"регистрационный_номер\" FROM \"Сады\"";

            List<int> Gardens_RN = convert_column_in_list(SQL_RN).Select(x => Convert.ToInt32(x)).ToList();

            //if (Gardens_RN == null)
            //    throw new Exception("В таблице отсутсвуют сады!");

            string SQL_Prof = "SELECT \"код_должности\" FROM \"Должности\"";
            List<int> Professions = MainForm.getDataTable(SQL_Prof).AsEnumerable().Select(r => r.Field<Int32>("код_должности")).ToList();

            Random random = new Random();


            for (int i = Count; i > 0 && !StopGenerate; --i)
            {
                int RegistrationNumber = Gardens_RN[random.Next(0, Gardens_RN.Count)];
                string[] FIO = get_random_FIO(random);
                DateTime DateBirth = get_RandomDate(new DateTime(DateTime.Now.Year - 19, DateTime.Now.Month, DateTime.Now.Day), random);
                int NumberProfessions = Professions[random.Next(0, Professions.Count)];
                int Salary = random.Next(0, 320000);
                int WorkExperience = random.Next(DateBirth.Year, DateTime.Now.Year - 18) - DateBirth.Year;

                string SQL_INSERT = "INSERT INTO \"Сотрудники\" ( \"регистрационный_номер_сада\", \"фамилия\", \"имя\", \"отчество\", \"дата_рождения\", \"номер_должности\", \"оклад\", \"стаж_работы\" ) VALUES " +
                    $"( {RegistrationNumber}, \'{FIO[0]}\', \'{FIO[1]}\', \'{FIO[2]}\', \'{DateBirth.ToString(DateFormat)}\', " +
                    $"{NumberProfessions}, {Salary}, {WorkExperience} );";

                try { MainForm.put_sql(SQL_INSERT); } catch {};

                //Console.WriteLine(SQL_INSERT);

                random = new Random(random.Next(0, int.MaxValue));

                if (progress != null)
                    progress(i);
            }

        }
        /// <summary>
        /// Генерирует дату от 1920 года, передаваемый параметр лимит
        /// </summary>
        /// <returns></returns>
        private static DateTime get_RandomDate(DateTime LimitEnd, Random random)
        {
            return get_RandomDate(new DateTime(1920, 1, 1), LimitEnd, random);
        }
        private static DateTime get_RandomDate(DateTime LimitStart, DateTime LimitEnd, Random random)
        {
            //Random random = new Random();
            DateTime start = new DateTime();
            start = LimitStart;
            int range = (LimitEnd - start).Days;
            return start.AddDays(random.Next(range));
        }
