        /// <summary>
        /// Генерирует рандомные номера
        /// </summary>
        /// <returns></returns>
        private static string getRandomNumber(Random random)
        {
            //Random random = new Random(new Random().Next(0, 100000000));

            long min = 100000000;
            long max = 9999999999;

            long result = random.Next((Int32)(min >> 32), (Int32)(max >> 32));
            result = (result << 32);
            result = result | (long)random.Next((Int32)min, (Int32)max);

            return $"+{random.Next(1, 999)}" + String.Format("{0: (###) ###-##-##}", result);
        }
