        /// <summary>
        /// Генерирует заданное количество записей для таблицы "Участки"
        /// </summary>
        /// <param name="Count"></param>
        public static void generateGardenPlots_2(int Count, ProgressBarDelegate progress)
        {
            Random random = new Random();

            string SQL_RN = "SELECT \"регистрационный_номер\" FROM \"Сады\"";
            string SQL_Plots = "SELECT \"регистрационный_номер_сада\", \"номер_участка_в_саду\" FROM \"Участки\" ORDER BY \"регистрационный_номер_сада\"";

            List<long> Gardens_RN = MainForm.getDataTable(SQL_RN).AsEnumerable().Select(r => r.Field<Int64>("регистрационный_номер")).ToList();
            DataTable AllPlots = MainForm.getDataTable(SQL_Plots);

            Dictionary<long, List<int>> hashGarden = new Dictionary<long, List<int>>();

            if(AllPlots != null)
            {
                long RN_Plot = 0;
                List<int> ListPlots = new List<int>();

                foreach (DataRow row in AllPlots.Rows)
                {
                    if (RN_Plot != Convert.ToInt64(row[0]))
                    {
                        hashGarden.Add(RN_Plot, ListPlots);
                        RN_Plot = Convert.ToInt64(row[0]);
                        ListPlots = new List<int>();
                    }

                    ListPlots.Add(Convert.ToInt32(row[1]));
                }
            }

            for (int i = Count; i > 0 && !StopGenerate; --i)
            {
                long GetRegistrationNumber = Gardens_RN[random.Next(0, Gardens_RN.Count)];

                int NumberPlot = 1;

                List<int> ListPlotsByGarden = new List<int>();

                if (hashGarden.ContainsKey(GetRegistrationNumber))
                    ListPlotsByGarden = hashGarden[GetRegistrationNumber].ToList();
                else
                    hashGarden.Add(GetRegistrationNumber, null);

                while (ListPlotsByGarden.IndexOf(NumberPlot) != -1)
                    NumberPlot++;

                ListPlotsByGarden.Add(NumberPlot);
                hashGarden[GetRegistrationNumber] = ListPlotsByGarden;

                string SQL_INSERT = "INSERT INTO \"Участки\" (\"номер_участка_в_саду\", \"регистрационный_номер_сада\") VALUES " +
                    $"({NumberPlot}, {GetRegistrationNumber});";

                try { MainForm.put_sql(SQL_INSERT); } catch {};

                //Console.WriteLine(SQL_INSERT);

                //await Task.Delay(1);
                if (progress != null)
                    progress(i);
            }
        }
        /// <summary>
        /// Преобразовывает колонку таблицы в список типа object
        /// </summary>
        /// <param name="SQL"></param>
        /// <returns></returns>
        public static List<object> convert_column_in_list(string SQL)
        {
            List<object> Result = new List<object>();

            DataTable dt = MainForm.getDataTable(SQL);

            foreach (DataRow row in dt.Rows)
            {
                Result.Add(row[0]);
            }

            if (Result.Count == 0)
                throw new Exception("Не возможно генерировать данные на основе пустой таблицы!");

            return Result;
        }
        public static List<List<object>> convert_all_columns_in_list(string SQL)
        {
            List<List<object>> Result = new List<List<object>>();

            DataTable dt = MainForm.getDataTable(SQL);

            for(int i = 0; i < dt.Columns.Count; ++i)
            {
                List<object> list = new List<object>();
                foreach (DataRow row in dt.Rows)
                {
                    list.Add(row[i]);
                }
                Result.Add(list);
            }

            return Result;
        }

